forIn = function(object,fn){for(var key in object){if(object.hasOwnProperty(key)){fn(key,object[key]);}}}
forEach = function(arr,fn){for(var i=0;i<arr.length;i++){fn(arr[i],i,arr);}}
map = function(arr,fn){var temp=[];for(var i=0;i<this.length;i++){temp.push(fn(arr[i],i,arr));}return temp;}
isArray = function(arr){return Object.prototype.toString.call(arr)=='[object Array]';}
