formatString = function(str,args){return str.replace(/\{\d+\}/g,function(text){var value=args[+text.substring(1,text.length-1)];return value===null?'':value;});}
clone = function(obj,skip,skipFunctions){if(!obj){return obj;}var type=typeof(obj);if(type!=='object'||obj instanceof Date){return obj;}var length;var o;if(obj instanceof Array){length=obj.length;o=new Array(length);for(var i=0;i<length;i++){type=typeof(obj[i]);if(type!=='object'||obj[i]instanceof Date){if(skipFunctions&&type==='function'){continue;}o[i]=obj[i];continue;}o[i]=exports.clone(obj[i],skip,skipFunctions);}return o;}o={};for(var m in obj){if(skip&&skip[m]){continue;}var val=obj[m];var type=typeof(val);if(type!=='object'||val instanceof Date){if(skipFunctions&&type==='function'){continue;}o[m]=val;continue;}o[m]=exports.clone(obj[m],skip,skipFunctions);}return o;}
TID = function(){var shifted=false;var last=arr[end];var id='';for(i=0;i<len;i++){id+=chars[arr[i]];}if(last==(num-1)){while(arr[pointer]==(num-1)){arr[pointer]=0;pointer--;}if(pointer!=-1){arr[pointer]=(arr[pointer]+1)%num}pointer=end;shifted=true;}if(!shifted){arr[pointer]=(arr[pointer]+1)%num}return id;}
UID = function(){return Math.ceil(Date.now()/1000)+'-'+U.TID();}
